import React from 'react';
import { Table } from 'reactstrap';

interface IProps{
    children: any;
}

const PrePage : React.FC<IProps> = ({children}) => {
    return(
        <div style={{
            width: "100%",
            maxHeight: "80vh",
            overflowY: 'auto'
        }}>
            <div style={{
                marginRight: "6vh",
                marginLeft: "6vh",
                marginBottom: "6vh",
                position: 'relative',
            }}
            className={"shadow mb-5 bg-white rounded"}
            >
                <Table hover responsive autoCapitalize={'on'}>
                    {children}
                </Table>    
            </div>
        </div>
    );
}  

export default PrePage;
